import TeamSection from "../components/Home/TeamSection";

const Home = () => {
  return (
    <>
      <LandingPage />
      <FeaturePage />
      <AboutSection />
      <ProductsSection />
      {/* <TeamSection /> */}
    </>
  );
};

export default Home;
